import React from "react";
import "./index.scss";

const ColorfulDash = () => {
    return (
        <div className="colorful-dash">
            <div className="colorful-dash-red"></div>
            <div className="colorful-dash-yellow"></div>
            <div className="colorful-dash-blue"></div>
            <div className="colorful-dash-green"></div>
        </div>
    );
};

export default ColorfulDash;
